INSERT INTO `lm_article` (`id`, `pid`, `title`, `description`, `content`, `author`, `author_email`, `keywords`, `article_type`, `status`, `file_url`, `open_type`, `link`, `click`, `publish_time`, `sort`, `thumb`, `tags`, `create_time`, `update_time`) VALUES
(1, 0, '基于TP6 layui开发的cms 后台管理系统', '基于TP6 layui开发的cms 后台管理系统', '<p>基于TP6 layui开发的cms 后台管理系统</p><p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 0px; padding: 0px; -webkit-tap-highlight-color: rgba(0, 0, 0, 0); overflow-wrap: break-word; max-width: 100%; line-height: 32px; color: rgb(119, 119, 119); font-family: &quot;Helvetica Neue&quot;, Helvetica, &quot;PingFang SC&quot;, Tahoma, Arial, sans-serif; white-space: normal; background-color: rgb(255, 255, 255);\"><img src=\"https://img.sheboo.cn/uploads/ueditor/image/20191024/1571887696120781.jpg\" title=\"1571887559457804.jpg\"/></p><p class=\"txt-con\" style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 0px; padding: 0px; -webkit-tap-highlight-color: rgba(0, 0, 0, 0); overflow-wrap: break-word; max-width: 100%; line-height: 32px; color: rgb(119, 119, 119); font-family: &quot;Helvetica Neue&quot;, Helvetica, &quot;PingFang SC&quot;, Tahoma, Arial, sans-serif; white-space: normal; background-color: rgb(255, 255, 255);\">砀山酥梨，安徽省砀山县特产，中国国家地理标志产品。砀山酥梨栽培历史悠久，是中国传统三大名梨之首，以其汁多味甜且具有润肺止作用而驰名中外。砀山酥梨已有千年历史，古时候作为贡梨上奉给朝廷。砀山酥梨不仅酥脆爽口，入口即化，营养价值与养生价值也极高。<br/>当所有实体零售都具有明显的&quot;电商&quot;基因特征之时，传统意义上的&quot;电商&quot;将不复存在，引导城市人了解乡村和乡村产品，帮助砀山县优质产品开拓新渠道，能够推动城乡资源协调，价值共享。在新零售体系下，线上线下和物流结合在一起。对砀山酥梨在互联网时代，新零售时代，建立强势本土品牌，丰富产品渠道具有重要意义，也是砀山酥梨等水果产品对新零售的重大实践。通过分析砀山酥梨产品现状，融合线上线下+物流的新零售商业模式，以交互性的展示方式进行综合性、系统性的设计配合以砀山梨文化，进行砀山&quot;趣果&quot;品牌升级，建立城乡资源协调，价值共享的新渠道。<br/><br/>现存问题：品牌形象不统一/亟待开发零售渠道<br/>解决问题：品牌形象升级/开拓零售新渠道</p><p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 0px; padding: 0px; -webkit-tap-highlight-color: rgba(0, 0, 0, 0); overflow-wrap: break-word; max-width: 100%; line-height: 32px; color: rgb(119, 119, 119); font-family: &quot;Helvetica Neue&quot;, Helvetica, &quot;PingFang SC&quot;, Tahoma, Arial, sans-serif; white-space: normal; background-color: rgb(255, 255, 255);\"><img src=\"https://img.sheboo.cn/uploads/ueditor/image/20191024/1571887696461242.jpg\" title=\"1571887559242116.jpg\"/></p><p